											"title": "Pray the Rosary, Glorious Mysteries",
											"description": "Praying the Holy Rosary is to pray and meditate on the Gospel; The mysteries of the events in the life of Jesus Christ and our Salvation.\r\n\r\nPope John Paul II has called the Rosary his \"favorite prayer,\" after the Mass and the Liturgy of the Hours.\r\n\r\n\"Say the Rosary every day...Pray, pray a lot and offer \r\nsacrifices for sinners...I'm Our Lady of the Rosary.\r\nOnly I will be able to help you.\r\n...In the end My Immaculate Heart will triumph.\"\r\n                 Our Lady at Fatima\r\n\r\n\"Pray! Pray very much! Offer prayers and sacrifices constantly to the Most High.\" \"Make everything you can a sacrifice, and offer it to God as an act of reparation for the sins by which He is offended...\" These were the words at the Angel's second appearance to the three children of Fatima.\r\n The faithful receive abundant grace of God.\r\n\r\nThe Fifteen Promises of the Virgin Mary to those who recite the Rosary \r\n\r\nIndulgences attached to the Rosary, Our Lady revealed to St. Dominic and Blessed Alan de la Roche benefits for those who devoutly pray the Rosary.  \r\n1. Whosoever shall faithfully serve me by the recitation of the Rosary shall receive signal graces.\r\n\r\n2. I promise my special protection and the greatest graces to all those who shall recite the Rosary.\r\n\r\n3. The Rosary shall be a powerful armor against hell, it will destroy vice, decrease sin and defeat heresies.\r\n\r\n4. It will cause good works to flourish; it will obtain for souls the abundant mercy of God; it will withdraw the hearts of men from the love of the world and its vanities, and will lift them to the desire for Eternal Things. Oh, that souls would sanctify themselves by this means.\r\n\r\n5. The soul which recommends itself to me by the recitation of the Rosary shall not perish.\r\n\r\n6. Whosoever shall recite the Rosary devoutly, applying himself to the consideration of its Sacred Mysteries shall never be conquered by misfortune. God will not chastise him in His justice, he shall not perish by an unprovided death; if he be just he shall remain in the grace of God, and become worthy of Eternal Life.\r\n\r\n7. Whoever shall have a true devotion for the Rosary shall not die without the Sacraments of the Church.\r\n\r\n8. Those who are faithful to recite the Rosary shall have during their life and at their death the Light of God and the plenitude of His Graces; at the moment of death they shall participate in the Merits of the Saints in Paradise.\r\n\r\n9. I shall deliver from purgatory those who have been devoted to the Rosary.\r\n\r\n10. The faithful children of the Rosary shall merit a high degree of Glory in Heaven.\r\n\r\n11. You shall obtain all you ask of me by recitation of the Rosary.\r\n\r\n12. All those who propagate the Holy Rosary shall be aided by me in their necessities.\r\n\r\n13. I have obtained from my Divine Son that all the advocates of the Rosary shall have for intercessors the entire Celestial Court during their life and at the hour of death.\r\n\r\n14. All who recite the Rosary are my Sons, and brothers of my Only Son Jesus Christ.\r\n\r\n15. Devotion to my Rosary is a great sign of predestination.\r\n\r\nReminder: these promises mean that, by faithfully and devoutly praying the Rosary and by being free from a deliberate will to sin, Our Lady will obtain for us the necessary Graces to obtain said promises. It is still up to each individual soul to respond to those Graces in order to obtain salvation.",
