										"description": "The Rosary video is a beautiful Rosary media. The soothing voices praying the Holy Rosary accompanied by gentle instrumental music and an ensamble of heavenly images and footages make this video both moving, inspiring and a joy to watch while meditating on the life of Jesus.\n\nThe Rosary video tell the story of the Annunciation, the Visitation, the Birth of Jesus, the Presentation and the Finding of the Child Jesus in the Temple.\n\nThe Joyful Mysteries Rosary video take less than a half hour to pray and are well worth the time. You will find yourself bringing to mind the images and humming the Marian hymn that is sung between each decade all throughout your day.\n\nTHE JOYFUL MYSTERIES\n\nThe Joyful Mysteries are taken mostly from St. Luke's Gospel in the New Testament. They involve the joyful events of Jesus' childhood.\n\nThe most joyful event in all of human history is the Incarnation or when God became man and dwelt among us.\n\nWhen Adam and Eve sinned against God, the gates of heaven were closed. God promised to send a saviour who would open the gates of heaven.\n\nJesus is the fulfillment of God's promise.\n\nThat is why the Incarnation is the most wonderful event in human history.\n\nThe Joyful Mysteries of the Rosary are so called because they recount all the Joys of the \"Good News\", namely Jesus.\n\nThe Annunciation - The angel announces that Jesus is to be born...\n\nThe Visitation - The baby in Elizabeth's womb leaps for joy when Mary who is pregnant with baby Jesus visits her...\n\nThe Birth of Jesus [The Nativity] - Jesus is born in a stable in Bethlehem...\n\nThe Presentation of Jesus in the Temple - Jesus is presented to God in the Temple in Jerusalem in accordance with Jewish Law...\n\nFinding Jesus in the Temple who was lost is found in the temple in Jerusalem teaching the high priests...\n\nTHE FRUITS OF THE ROSASRY\n\nFruits of the Rosary are evident within each mystery of the Rosary which bears it's own specific fruit. This means that meditations on the Rosary actually make you grow in virtue and holiness.\n\n1. The Annunciation: Humility. \n2. The Visitation: Charity. \n3. The Birth of our Lord: Poverty, or detachment from the world. \n4. The Presentation of Our Lord: Purity of heart, obedience. \n5. The Finding of Our Lord in the Temple: Piety.\n\nHELPFUL LINKS:\n\nLearn How to Pray the Rosary\nhttp://www.how-to-pray-the-rosary-everyday.com/rosary-guide.html\n\nCatholics Come Home\nhttp://www.catholicscomehome.org/\n\nThe Coming Home Network\nhttp://chnetwork.org/\n\nCatechism of the Catholic Church\nhttp://www.vatican.va/archive/ENG0015/_INDEX.HTM"
